INSERT INTO project (id,title, description, link) VALUES 
(1,'Google', 'Google.com is a comprehensive search engine and online platform offering users access to global information. With its simple, intuitive interface, Google enables searches across web pages, images, news, and videos from one central site. Powered by sophisticated algorithms, Google optimizes search results to present relevant and reliable content from billions of web pages. Additionally, Google.com links users to essential tools like Gmail, Google Maps, and Google Drive, alongside productivity and media services, establishing it as an indispensable online resource for information access and organization.', 'https://www.google.com'),
(2,'Google 2', 'Google.com is a vast search engine and online platform granting access to the world’s information. The intuitive interface allows for searches across websites, images, news, and more, powered by advanced algorithms that enhance content relevance and reliability. Google also connects users to tools like Gmail, Google Maps, and Google Drive, plus a suite of productivity and media services, making it a valuable tool for organizing online data. This centralization of essential resources reinforces Google’s role as a primary online information hub.', 'https://www.google.com'),
(3,'Google 3', 'Google.com, a leading search engine and online platform, provides access to global information through an intuitive interface. It allows users to search web pages, images, news, and more, optimized by powerful algorithms ensuring relevant and dependable results. In addition, Google.com connects users to key services, including Gmail, Google Maps, and Google Drive, making it a crucial online resource for information access and organization. Its combination of simplicity, reliability, and comprehensive services makes Google indispensable for online navigation and productivity.', 'https://project3.com'),
